IE_DETAIL_TEXT:
Коронкосниматель с запасными щечками +
адгезивный порошок
безопасные и щадящие инструменты для снятия коронок и мостов
благодаря своей форме пригодны для верхней и нижней челюсти;
полимерные щечки и специальный порошок обеспечивают высочайшую
степень адгезии;
специальный адгезивный порошок стерилизован гаmmа-лучами;
снабжены регулировочным винтом и возвратной пружиной для
надежной корректной фиксации;
плимерные щечки легко заменяются
